import React, { Component } from 'react';
import { Palette } from 'react-palette';

class TheColor extends Component {
    render() {
        return (
            <div>
                <Palette src={'https://upload.wikimedia.org/wikipedia/en/c/cc/Mayer_Thursday.jpg'}>
                    {({ data, loading, error }) => (
                        <div style={{ backgroundColor: data.darkMuted }}>
                            Text with the vibrant color
                            {console.log(data.darkMuted)}
                        </div>
                    )}
                </Palette>
            </div>
        )

    }
}


export default TheColor;
